import React, { useState } from 'react';

const NewCam = () => {
  const [link, setLink] = useState("vid.mp4"); 

  return (
    <div>
      <div className="row">
        <div className="col-md-6" style={{ position: 'relative' }}>
          <video src={link} controls style={{ zIndex: 0, width: '100%' }} />
        </div>
      </div>
    </div>
  );
};

export default NewCam;
